import "./index.css";
import { Link } from "react-router-dom";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

const App = () => {
  const onClick = () => {
    console.log("Click");
  };

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <div className="container">
              <button className="Button" onClick={onClick}>
                Click
              </button>
            </div>
          }
        />
      </Routes>
    </Router>
  );
};

export default App;
